export const styles = theme => ({
    root: {
        [theme.breakpoints.between("md", "xl")]: {
            borderRadius: 0,
            minHeight: "332px",
            padding: `${theme.spacing(15)}px ${theme.spacing(3)}px ${theme.spacing(
                3
            )}px`,
        },
        [theme.breakpoints.between("xs", "md")]: {
            background: "none",
            boxShadow: "none",
            paddingRight: 0,
        },
    },
    container: {
        [theme.breakpoints.between("xs", "md")]: {
            padding: 0,
        },
    },
    card: {
        zIndex: theme.level.content + 1,
        [theme.breakpoints.between("xs", "md")]: { minHeight: "610px" },
        [theme.breakpoints.between("md", "xl")]: { minHeight: "465px" },
    },
    logo: {
        marginTop: "200px",
        width: "50px",
        [theme.breakpoints.between("xs", "md")]: { display: "none" },
    },
    title: {
        display: "block",
        [theme.breakpoints.between("md", "xl")]: {
            color: theme.palette.white.main,
            margin: `${theme.spacing(3)}px 0`,
        },
    },
    submarino: { [theme.breakpoints.between("xs", "md")]: { display: "block" } },
    subtitle: {
        display: "block",
        [theme.breakpoints.between("md", "xl")]: {
            color: theme.palette.white.main,
        },
        [theme.breakpoints.between("xs", "md")]: { marginBottom: theme.spacing(2) },
    },
});
